From NBC:
IT&amp;#039;S ELECTION DAY ON THE WEST WING - The night before Election Day makes for interesting bedfellows. Josh (Brad Whitford) stresses over returns. Meanwhile, CJ (Allison Janney) is faced with her future job offers. Anabeth (Kristin Chenoweth) makes a startling discovery. 

From TV Guide: 
Election Day finally arrives, and between analyzing exit polls and mulling over news reports, a few Santos staff members discover the joys of campaign romance. Meanwhile, C.J. ponders life after the White House; and Annabeth makes a tragic discovery.
